import React from 'react';
import '../assets/scss/main.scss';
import News from './News';

interface ICarouselProps {
  index: number;
  onRotateClick: (rotateLeft: boolean) => any; 
}

class Carousel extends React.Component<ICarouselProps> {



  public render() {

    const newsList = [
      <News title={'La Seguridad Social abona 80,6 millones de euros en prestaciones por la pandemia a 99.000 autónomos en octubre'} subtitle={'Hay más de 180.000 trabajadores por cuenta propia que han vuelto a la actividad totalmente y verán reducida su cuota en un 90%. Se han destinado 7.600 millones en estas ayudas y otros 3.550 en exoneraciones para autónomos desde el inicio de la pandemia'} author={'Redaccion'} body={"La Seguridad Social abona este mes una nómina estimada de 80,6 millones de euros en prestaciones a autónomos. Unos 99.000 trabajadores por cuenta propia recibirán este mes alguna de las prestaciones específicas para el colectivo puestas en marcha para paliar los efectos de la pandemia de la COVID-19, a los que se han sumado los trabajadores autónomos afectados por la erupción volcánica en Cumbre Vieja, en la Isla de La Palma. Todas estas prestaciones incluyen exenciones en las cuotas.\nA ellos se suman los 181.500 autónomos a los que se les ha aplicado la exención del 90% de la cuota. Esta exoneración está prevista para quienes se habían beneficiado de una prestación hasta el 30 de septiembre y han vuelto a la actividad completamente.\nLas ayudas para los autónomos que continúen muy afectados por la pandemia y las nuevas exoneraciones a la Seguridad Social para aquellos que reactiven su actividad hasta enero están recogidas en el Real Decreto-ley 18/2021. En virtud del mismo texto, y después del acuerdo con las asociaciones de autónomos, el esquema de ayudas se ha extendido hasta febrero de 2022.\nEn el momento de mayor afectación de la situación sanitaria en el mercado de trabajo, se llegó a proteger a 1,46 millones de trabajadores y trabajadoras por cuenta propia. Desde entonces, la nómina total abonada en concepto de estas prestaciones suma más de 7.600 millones de euros de euros, a la que se suman otros más de 3.550 millones en exoneraciones de cuotas aplicadas a los trabajadores autónomos con ayudas."} date={'29/10/2021'} imageUrl={'https://i1.wp.com/revista.seg-social.es/wp-content/uploads/2021/10/IMG_9501-copia.jpg?resize=620%2C264&ssl=1'} collapsed={true} />,
      <News title={'Title 2'} subtitle={'This is the subtitle'} author={'Author'} body={'body'} date={'14/10/2021'} imageUrl={'https://i2.wp.com/revista.seg-social.es/wp-content/uploads/2021/10/1a-EDICION-8M6H0859-copia.jpg?resize=620%2C264&ssl=1'} collapsed={true} />,
      <News title={'Title 3'} subtitle={'This is the subtitle'} author={'Author'} body={'body'} date={'14/10/2021'} imageUrl={'https://i2.wp.com/revista.seg-social.es/wp-content/uploads/2021/10/1a-EDICION-8M6H0859-copia.jpg?resize=620%2C264&ssl=1'} collapsed={true} />,
      <News title={'Title 4'} subtitle={'This is the subtitle'} author={'Author'} body={'body'} date={'14/10/2021'} imageUrl={'https://i2.wp.com/revista.seg-social.es/wp-content/uploads/2021/10/1a-EDICION-8M6H0859-copia.jpg?resize=620%2C264&ssl=1'} collapsed={true} />,
      <News title={'Title 4'} subtitle={'This is the subtitle'} author={'Author'} body={'body'} date={'14/10/2021'} imageUrl={'https://i2.wp.com/revista.seg-social.es/wp-content/uploads/2021/10/1a-EDICION-8M6H0859-copia.jpg?resize=620%2C264&ssl=1'} collapsed={true} />,
      <News title={'Title 4'} subtitle={'This is the subtitle'} author={'Author'} body={'body'} date={'14/10/2021'} imageUrl={'https://i2.wp.com/revista.seg-social.es/wp-content/uploads/2021/10/1a-EDICION-8M6H0859-copia.jpg?resize=620%2C264&ssl=1'} collapsed={true} />
    ]

    const onClickLeft = () => {
      this.props.onRotateClick(true);
    }

    const onClickRight = () => {
      this.props.onRotateClick(false);
    }

    return (
      <div id='enveloped' className="container-xxl">
        <div id="leftArrow" onClick={onClickLeft}>
          &#60;
        </div>
        <div id="newsCard">
          {newsList[this.props.index]}
        </div>
        <div id="rightArrow" onClick={onClickRight}>
          &#62;
        </div>
      </div>
    );
  }
}

export default Carousel;
